import React from "react";
import { NavLink } from "react-router-dom";
const Navbar = () =>{
    return(
        <div>
                 <nav>
                    <NavLink to="/">
                        <div>
                        <img src="../logo.png"></img>
                        </div>
                    </NavLink>
                 </nav>
        </div>
    );
}
export default Navbar;
